--
-- Triggers `project_structures`
--
DELIMITER $$
CREATE TRIGGER `update_project` AFTER UPDATE ON `project_structures` FOR EACH ROW BEGIN
                SET @id = new.id_project;
            
                set @beres = (SELECT COUNT(IF(status=0,1,null)) = 0
                from project_structures
                where id_project = @id
                group by id_project);       
                
                IF @beres = 1 then
                    BEGIN
                        update projects
                        set status = 1
                        where id_project = @id;            
                    END;
                ELSE
                    BEGIN
                        update projects
                        set status = 0
                        where id_project = @id;               
                    END;
                END IF;
            END
$$
DELIMITER ;

